#include <iostream>
using namespace std;

struct ListNode {
    char val;
    ListNode *next;
};

void insert(ListNode **ref, char data) {
    ListNode *newn = new ListNode;
    newn->val = data;
    newn->next = NULL;
    
    if (*ref == NULL) {
        *ref = newn;
    } else {
        ListNode *temp = *ref;
        while (temp->next != NULL) {
            temp = temp->next;
        }
        temp->next = newn;
    }
}

void display(ListNode *ref) {
    ListNode *temp = ref;
    while (temp != NULL) {
        cout << temp->val << " ";
        temp = temp->next;
    }
    cout << endl;
}

bool checkIfPresent(ListNode *charCol, char key) {
    while (charCol != NULL) {
        if (key == charCol->val) {
            return true;
        }
        charCol = charCol->next;
    }
    return false;
}

int lengthOfLongestSubstring(string s) {
    int sptr = 0, eptr = 0;
    int longest = 0;
    ListNode *myList = NULL;
    for (int i = 0; i < s.length(); i++) {
        if (!checkIfPresent(myList, s[i])) {
            eptr = i;
            insert(&myList, s[i]);
            longest = max(longest, (eptr - sptr + 1));
        } else {
            i = sptr + 1;
            myList = NULL;
            insert(&myList, s[i]);
            sptr = i;
        }
        display(myList);
    }
    return longest;
}

